import React, { Component } from 'react';
import Card from './Card.js'
import './ImageGrid.css';

class ImageGrid extends Component {
  render() {
    return (
      <div>
        <div className="container">

        	<div className="row">
			    <div class="col-md-3">
					<Card/>
				</div>

				<div class="col-md-3">
					<Card/>
				</div>

				<div class="col-md-3">
					<Card/>
				</div>

				<div class="col-md-3">
					<Card/>
				</div>

        	</div>

        </div>
      </div>
    );
  }
}

export default ImageGrid;
